  const { getAccessTokenSilently } = useAuth0();
  const myHeaders:object = new Headers();
  myHeaders.set("Authorization", "Bearer" + getAccessTokenSilently()) 
    useEffect(
      () => {
        console.log(getAccessTokenSilently())
        axios("http://localhost:3000/api/private", { headers: { Authorization: "bearer" + getAccessTokenSilently()}
        })
        .then((res) => {
          alert(res)
          return res;
        })
        .catch((err) => {
          console.log(err);
        });
        alert(Response);
